import React from "react";
import GenerateButton from "./GenerateBtn";
import UploadButton from "./UploadBtn";


const UploadPage = () => {
    return (
        <React.Fragment>
            <h1>Upload Page</h1>
            <div>
                <img src="../../../image/Course Dataset.png" alt="CourseDataset"></img>
                <img src="../../../image/Room Dataset.png" alt="RoomDataset"></img>
            </div>
            <div>
                <GenerateButton></GenerateButton>    
                <UploadButton></UploadButton>
            </div>
        </React.Fragment>
        
    );
};

export default UploadPage;
